### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. Search Algorithms
**Core Topics:**
- A* Algorithm
- WA* Algorithm
- Branch-and-Bound Algorithm
- Heuristic Functions (e.g., Manhattan Distance)
- Tie-breaking Rules

**Concepts and Principles:**
- **A* Algorithm:** Uses a combination of the cost to reach the node and a heuristic estimate of the cost to reach the goal.
- **WA* Algorithm:** A weighted version of A* that allows for suboptimal paths but can be more efficient.
- **Branch-and-Bound:** A method for optimizing problems by systematically enumerating candidate solutions and abandoning a candidate ("branching") if it cannot possibly lead to a better solution than the best one found so far ("bounding").
- **Manhattan Distance:** A heuristic that estimates the distance between two points in a grid-based pathfinding context.

**Equations:**
- **A* Algorithm:** \( f(n) = g(n) + h(n) \)
  - \( g(n) \): Cost from the start node to node \( n \)
  - \( h(n) \): Heuristic estimate of the cost from node \( n \) to the goal
- **WA* Algorithm:** \( f(n) = g(n) + w \cdot h(n) \)
  - \( w \): Weight factor

#### 2. Traveling Salesman Problem (TSP)
**Core Topics:**
- Branch-and-Bound for TSP
- Lower Bound Calculation
- Permanent and Excluded Edges
- Tour Estimation

**Concepts and Principles:**
- **Branch-and-Bound for TSP:** Involves systematically exploring possible tours and using bounds to eliminate suboptimal paths.
- **Lower Bound:** The minimum possible cost of a tour, often calculated using the sum of the smallest edges.
- **Permanent Edges:** Edges that must be included in the final tour.
- **Excluded Edges:** Edges that cannot be included in the final tour.

**Equations:**
- **Lower Bound Calculation:** Sum of the smallest edges for each node.
- **Tour Estimation:** Sum of the costs of the edges included in the partial solution plus the lower bound for the remaining nodes.

#### 3. Game Theory
**Core Topics:**
- Game Trees
- Minimax Algorithm
- Alpha-Beta Pruning
- SSS* Algorithm
- Horizon Nodes

**Concepts and Principles:**
- **Game Trees:** Represent the possible moves and outcomes in a game.
- **Minimax Algorithm:** A recursive algorithm for choosing the next move in a game, assuming the opponent plays optimally.
- **Alpha-Beta Pruning:** An optimization technique for the minimax algorithm that reduces the number of nodes evaluated.
- **SSS* Algorithm:** A selective search algorithm that explores the most promising nodes first.
- **Horizon Nodes:** Nodes at the depth limit of the search tree.

**Equations:**
- **Minimax Algorithm:** \( \text{value}(node) = \max(\text{values of child nodes}) \) for maximizing player, \( \min(\text{values of child nodes}) \) for minimizing player.
- **Alpha-Beta Pruning:** \( \alpha \) is the best value found so far for the maximizing player, \( \beta \) is the best value found so far for the minimizing player.

#### 4. Automated Planning
**Core Topics:**
- Goal Stack Planning
- Predicates and Operators
- Subgoal Ordering
- Optimal Plans

**Concepts and Principles:**
- **Goal Stack Planning:** A planning algorithm that uses a stack to keep track of subgoals.
- **Predicates and Operators:** Define the state of the world and the actions that can be taken.
- **Subgoal Ordering:** The order in which subgoals are pushed onto the stack can affect the efficiency and optimality of the plan.
- **Optimal Plans:** Plans that achieve the goal with the least cost or number of actions.

**Equations:**
- **Subgoal Ordering:** Depends on the specific problem and tie-breaking rules.
- **Optimal Plans:** Minimizing the number of actions or the cost of the plan.

